class Solution {
    // Function to reverse a given string
    public String reverseString(String str) {
        return new StringBuilder(str).reverse().toString();
    }

    public String make_palindrome(String string) {
        int i = string.length();
        while (i > 0) {
            if (isPalindrome(string.substring(0, i))) {
                break;
            }
            i--;
        }

        if (i == string.length()) {
            return string;
        } else {
            return string + reverseString(string.substring(i));
        }
    }

