class Solution {
    public List<Integer> sum_product(List<Integer> numbers) {
        int sum = 0;
        int product = 1;

        if (numbers.isEmpty()) {
            return Arrays.asList(0, 1);
        }

        for (int num : numbers) {
            sum += num;
            product *= num;
        }

        return Arrays.asList(sum, product);
    }
}

