class Solution {
    public String sort_numbers(String numbers) {
        // Create a map to store word to number mapping
        Map<String, Integer> wordToNumber = new HashMap<>();
        wordToNumber.put("zero", 0);
        wordToNumber.put("one", 1);
        wordToNumber.put("two", 2);
        wordToNumber.put("three", 3);
        wordToNumber.put("four", 4);
        wordToNumber.put("five", 5);
        wordToNumber.put("six", 6);
        wordToNumber.put("seven", 7);
        wordToNumber.put("eight", 8);
        wordToNumber.put("nine", 9);

        // Tokenize the input string
        String[] tokens = numbers.split(" ");

        // Create a list to store numerical values
        List<Integer> numericalValues = new ArrayList<>();

        // Iterate over tokens and map words to numbers
        for (String token : tokens) {
            numericalValues.add(wordToNumber.get(token));
        }

        // Sort the numerical values
        Collections.sort(numericalValues);

        // Create a list to store sorted word representations
        List<String> sortedWords = new ArrayList<>();

        // Iterate over sorted numerical values and map numbers to words
        for (int num : numericalValues) {
            for (Map.Entry<String, Integer> entry : wordToNumber.entrySet()) {
                if (entry.getValue() == num) {
                    sortedWords.add(entry.getKey());
                    break;
                }
            }
        }

        // Join the sorted word representations into a single string
        String sortedString = String.join(" ", sortedWords);

        return sortedString;
    }
}

