class Solution {
    public double poly(List<Double> xs, double x) {
        double result = 0;
        for (int i = 0; i < xs.size(); i++) {
            result += xs.get(i) * Math.pow(x, i);
        }
        return result;
    }

    public double find_zero(List<Double> xs) {
        if (xs.size() % 2 != 0 || xs.get(xs.size() - 1) == 0) {
            System.out.println("Invalid input: List must have even number of coefficients with largest non-zero coefficient.");
            return Double.MIN_VALUE;
        }

        double lowerBound = -1000;
        double upperBound = 1000;
        double epsilon = 0.0001;

        while (upperBound - lowerBound > epsilon) {
            double mid = (lowerBound + upperBound) / 2;
            double midValue = poly(xs, mid);

            if (midValue == 0) {
                return mid;
            } else if (midValue * poly(xs, lowerBound) < 0) {
                upperBound = mid;
            } else {
                lowerBound = mid;
            }
        }

        return (lowerBound + upperBound) / 2;
    }
}

