        List<Integer> oddIndices = new ArrayList<>();

        for (int i = 0; i < l.size(); i++) {
            if (i % 2 == 0) {
                sortedEven.add(l.get(i));
            } else {
                oddIndices.add(l.get(i));
            }
        }

        Collections.sort(sortedEven);

        List<Integer> modifiedList = new ArrayList<>();
        int evenIndex = 0;
        int oddIndex = 0;

        for (int i = 0; i < l.size(); i++) {
            if (i % 2 == 0) {
