class Solution {
    public int car_race_collision(int n) {
        int collisions = 0;
        int[] leftToRight = new int[n];
        int[] rightToLeft = new int[n];

        // Initialize positions of cars
        for (int i = 0; i < n; i++) {
            leftToRight[i] = i;
            rightToLeft[i] = 3 * n - i; // Initial positions are far apart
        }

        // Simulate car movement and check for collisions
        for (int time = 0; time < 2 * n; time++) {
            for (int i = 0; i < n; i++) {
                leftToRight[i]++;
                rightToLeft[i]--;
                if (leftToRight[i] == rightToLeft[i]) {
                    collisions++;
                }
            }
        }

        return collisions;
    }
}

