class Solution {
    public String change_base(int x, int base) {
        if (x == 0) {
            return "0";
        }

        StringBuilder result = new StringBuilder();

        while (x > 0) {
            int remainder = x % base;
            result.insert(0, Integer.toString(remainder));
            x /= base;
        }

        return result.toString();
    }
}

