class Solution {
    public int fibfib(int n) {
        Map<Integer, Integer> memo = new HashMap<>();
        return fibfibHelper(n, memo);
    }

    private int fibfibHelper(int n, Map<Integer, Integer> memo) {
        if (n == 0 || n == 1) {
            return 0;
        }
        if (n == 2) {
            return 1;
        }
        if (memo.containsKey(n)) {
            return memo.get(n);
        }
        int fib = fibfibHelper(n - 1, memo) + fibfibHelper(n - 2, memo) + fibfibHelper(n - 3, memo);
        memo.put(n, fib);
        return fib;
    }
}

