class Solution {
    // Function to generate all prime numbers less than 100
    public List<Integer> generatePrimes() {
        List<Integer> primes = new ArrayList<>();
        boolean[] isPrime = new boolean[100];
        Arrays.fill(isPrime, true);

        for (int p = 2; p * p < 100; p++) {
            if (isPrime[p]) {
                for (int i = p * p; i < 100; i += p) {
                    isPrime[i] = false;
                }
            }
        }

        for (int i = 2; i < 100; i++) {
            if (isPrime[i]) {
                primes.add(i);
            }
        }
        return primes;
    }

    // Function to check if a number is prime
    public boolean isPrime(int num) {
        if (num <= 1) {
            return false;
        }
        for (int i = 2; i * i <= num; i++) {
            if (num % i == 0) {
                return false;
            }
        }
        return true;
    }

    // Function to check if the given number is the multiplication of 3 prime numbers
    public boolean is_multiply_prime(int a) {
        List<Integer> primes = generatePrimes();

        for (int i = 0; i < primes.size(); i++) {
            for (int j = i + 1; j < primes.size(); j++) {
                for (int k = j + 1; k < primes.size(); k++) {
                    if (a == primes.get(i) * primes.get(j) * primes.get(k)) {
                        return true;
                    }
                }
            }
        }
        return false;
    }
}

