class Solution {
    public int smallest_change(List<Integer> arr) {
        int changes = 0;
        int start = 0;
        int end = arr.size() - 1;

        while (start < end) {
            if (!arr.get(start).equals(arr.get(end))) {
                changes++;
            }
            start++;
            end--;
        }

        return changes;
    }
}

