class Solution {
    public boolean will_it_fly(List<Integer> q, int w) {
        // Check if the list is palindromic
        boolean isBalanced = true;
        for (int i = 0; i < q.size() / 2; i++) {
            if (!q.get(i).equals(q.get(q.size() - i - 1))) {
                isBalanced = false;
                break;
            }
        }

        // Calculate the sum of elements
        int sum = 0;
        for (int num : q) {
            sum += num;
        }

        // Check if it will fly
        return isBalanced && sum <= w;
    }
}

