class Solution {
    public String decimal_to_binary(int decimal) {
        StringBuilder binary = new StringBuilder();
        binary.append("db");

        // Convert decimal to binary
        while (decimal > 0) {
            int bit = decimal % 2;
            binary.insert(2, bit); // Insert at index 2 to maintain 'db' at the beginning
            decimal /= 2;
        }

        binary.append("db");
        return binary.toString();
    }
}

