class Solution {
    public String solve(int N) {
        int sum = 0;

        // Calculate the sum of digits
        while (N > 0) {
            sum += N % 10;
            N /= 10;
        }

        // Convert sum to binary string
        return Integer.toBinaryString(sum);
    }
}

