class Solution {
    public Optional<Integer> next_smallest(List<Integer> lst) {
        if (lst.isEmpty() || lst.size() == 1) {
            return Optional.empty();
        }

        List<Integer> sortedList = new ArrayList<>(new HashSet<>(lst)); // Remove duplicates
        Collections.sort(sortedList);

        int count = 0;
        for (int i = 1; i < sortedList.size(); i++) {
            if (!sortedList.get(i).equals(sortedList.get(i - 1))) {
                count++;
            }
            if (count == 2) {
                return Optional.of(sortedList.get(i));
            }
        }

        return Optional.empty();
    }
}

