class Solution {
    public Object rounded_avg(int n, int m) {
        if (n > m) {
            return -1;
        }

        int sum = 0;
        int count = m - n + 1;

        for (int i = n; i <= m; i++) {
            sum += i;
        }

        int avg = Math.round((float) sum / count);
        String binary = Integer.toBinaryString(avg);

        return binary;
    }
}

