class Solution {
    public int count_nums(List<Integer> arr) {
        int count = 0;

        for (int num : arr) {
            int sum = 0;
            int n = Math.abs(num); // Convert to positive number

            while (n != 0) {
                sum += n % 10; // Add last digit to sum
                n /= 10; // Remove last digit
            }

            if (sum > 0) {
                count++;
            }
        }

        return count;
    }
}

