class Solution {
    public String exchange(List<Integer> lst1, List<Integer> lst2) {
        int oddCount = 0;

        for (int num : lst1) {
            if (num % 2 != 0) {
                oddCount++;
            }
        }

        if (oddCount > 1) {
            return "NO";
        }

        for (int num : lst2) {
            if (num % 2 != 0) {
                oddCount++;
            }
        }

        if (oddCount == 1) {
            return "YES";
        } else if (oddCount == 0) {
            return "YES";
        } else {
            return "NO";
        }
    }
}

