class Solution {
    public List<Object> reverse_delete(String s, String c) {
        String result = "";
        for (int i = 0; i < s.length(); i++) {
            if (c.indexOf(s.charAt(i)) == -1) {
                result += s.charAt(i);
            }
        }

        boolean isPalindrome = true;
        int start = 0, end = result.length() - 1;
        while (start < end) {
            if (result.charAt(start) != result.charAt(end)) {
                isPalindrome = false;
                break;
            }
            start++;
            end--;
        }

        List<Object> output = new ArrayList<>();
        output.add(result);
        output.add(isPalindrome);

        return output;
    }
}

