class Solution {
    public List<Object> reverse_delete(String s, String c) {
        Set<Character> charSet = new HashSet<>();
        for (char ch : c.toCharArray()) {
            charSet.add(ch);
        }

        StringBuilder result = new StringBuilder();
        for (char ch : s.toCharArray()) {
            if (!charSet.contains(ch)) {
                result.append(ch);
            }
        }

        StringBuilder reversed = new StringBuilder(result).reverse();
        boolean isPalindrome = result.toString().equals(reversed.toString());

        return Arrays.asList(result.toString(), isPalindrome);
    }
}

