        Comparator<Integer> customComparator = (a, b) -> {
            int countA = Integer.bitCount(Math.abs(a)); // Count of ones in binary representation of a
            int countB = Integer.bitCount(Math.abs(b)); // Count of ones in binary representation of b

            if (countA == countB) {
