class Solution {
    public String match_parens(List<String> lst) {
        String concatenated = lst.get(0) + lst.get(1);
        Stack<Character> stack = new Stack<>();

        for (char c : concatenated.toCharArray()) {
            if (c == '(') {
                stack.push(c);
            } else if (c == ')') {
                if (stack.isEmpty()) {
                    return "No";
                }
                stack.pop();
            }
        }

        return stack.isEmpty() ? "Yes" : "No";
    }
}

