class Solution {
    public Object split_words(String txt) {
        List<String> words = new ArrayList<>();
        if (txt.contains(" ")) {
            words = Arrays.asList(txt.split(" "));
            return words;
        } else if (txt.contains(",")) {
            words = Arrays.asList(txt.split(","));
            return words;
        } else {
            int count = 0;
            for (char c : txt.toCharArray()) {
                if (Character.isLowerCase(c) && (c - 'a') % 2 != 0) {
                    count++;
                }
            }
            return count;
        }
    }
}

