class Solution {
    List<Integer> minPath(List<List<Integer>> grid, int k) {
        List<Integer> minPath = new ArrayList<>();
        List<Integer> currentPath = new ArrayList<>();
        boolean[][] visited = new boolean[grid.size()][grid.get(0).size()];

        for (int i = 0; i < grid.size(); i++) {
            for (int j = 0; j < grid.get(0).size(); j++) {
                dfs(grid, i, j, k, visited, currentPath, minPath);
            }
        }

        return minPath;
    }

    void dfs(List<List<Integer>> grid, int row, int col, int k, boolean[][] visited, List<Integer> currentPath, List<Integer> minPath) {
        if (row < 0 || row >= grid.size() || col < 0 || col >= grid.get(0).size() || visited[row][col]) {
            return;
        }

        visited[row][col] = true;
        currentPath.add(grid.get(row).get(col));

        if (currentPath.size() == k) {
            if (minPath.isEmpty() || comparePaths(currentPath, minPath) < 0) {
                minPath.clear();
                minPath.addAll(currentPath);
            }
        } else {
            dfs(grid, row + 1, col, k, visited, currentPath, minPath);
            dfs(grid, row - 1, col, k, visited, currentPath, minPath);
            dfs(grid, row, col + 1, k, visited, currentPath, minPath);
            dfs(grid, row, col - 1, k, visited, currentPath, minPath);
        }

        visited[row][col] = false;
        currentPath.remove(currentPath.size() - 1);
    }

    int comparePaths(List<Integer> path1, List<Integer> path2) {
        for (int i = 0; i < path1.size(); i++) {
            if (path1.get(i) < path2.get(i)) {
                return -1;
            } else if (path1.get(i) > path2.get(i)) {
                return 1;
            }
        }
        return 0;
    }
}

