            dfs(grid, row - 1, col, k, currentPath, minPath, visited);
            dfs(grid, row, col + 1, k, currentPath, minPath, visited);
            dfs(grid, row, col - 1, k, currentPath, minPath, visited);
        }

        currentPath.remove(currentPath.size() - 1);
