    public Optional<Object> compare_one(Object a, Object b) {
        if (a instanceof Integer && b instanceof Integer) {
            int intA = (int) a;
            int intB = (int) b;
            if (intA > intB) {
                return Optional.of(intA);
            } else if (intB > intA) {
                return Optional.of(intB);
            }
        } else if (a instanceof Float && b instanceof Float) {
            float floatA = (float) a;
            float floatB = (float) b;
            if (floatA > floatB) {
                return Optional.of(floatA);
            } else if (floatB > floatA) {
                return Optional.of(floatB);
            }
        } else if ((a instanceof Integer && b instanceof Float) || (a instanceof Float && b instanceof Integer)) {
            float numA = a instanceof Integer ? (float) (int) a : (float) a;
            float numB = b instanceof Integer ? (float) (int) b : (float) b;
            if (numA > numB) {
                return Optional.of(numA);
            } else if (numB > numA) {
                return Optional.of(numB);
            }
        } else if (a instanceof String && b instanceof String) {
            float numA = Float.parseFloat(((String) a).replace(",", "."));
            float numB = Float.parseFloat(((String) b).replace(",", "."));
            if (numA > numB) {
                return Optional.of(a);
            } else if (numB > numA) {
                return Optional.of(b);
            }
        }
        return Optional.empty();
    }
