class Solution {
    public List<Integer> order_by_points(List<Integer> nums) {
        // Custom comparator to compare integers based on sum of digits and index
        Comparator<Integer> customComparator = new Comparator<Integer>() {
            @Override
            public int compare(Integer num1, Integer num2) {
                int sum1 = calculateDigitSum(num1);
                int sum2 = calculateDigitSum(num2);
                if (sum1 != sum2) {
                    return sum1 - sum2;
                } else {
                    return nums.indexOf(num1) - nums.indexOf(num2);
                }
            }
        };

        // Calculate sum of digits for a given number
        int calculateDigitSum(int num) {
            int sum = 0;
            String numStr = String.valueOf(Math.abs(num));
            for (char c : numStr.toCharArray()) {
                sum += Character.getNumericValue(c);
            }
            return sum;
        }

        // Sort the list based on custom comparator
        Collections.sort(nums, customComparator);

        return nums;
    }
}

