import java.math.BigInteger;
import java.util.stream.Collectors;
import java.security.*;
import java.util.*;
import java.lang.*;
import java.util.*;
import java.lang.*;

class Solution {
    public List<Integer> order_by_points(List<Integer> nums) {
        Collections.sort(nums, new Comparator<Integer>() {
            @Override
            public int compare(Integer a, Integer b) {
                int sumA = calculateSumOfDigits(a);
                int sumB = calculateSumOfDigits(b);

                if (sumA != sumB) {
                    return sumA - sumB;
                } else {
                    return nums.indexOf(a) - nums.indexOf(b);
                }
            }
        });
        return nums;
    }

    private int calculateSumOfDigits(int num) {
        int sum = 0;
        while (num != 0) {
            sum += num % 10;
            num /= 10;
        }
        return sum;
    }
}

