class Solution {
    public String file_name_check(String file_name) {
        String[] parts = file_name.split("\\.");

        if (parts.length != 2) {
            return "No";
        }

        String beforeDot = parts[0];
        String afterDot = parts[1];

        if (!beforeDot.matches("^[a-zA-Z].*")) {
            return "No";
        }

        if (!Arrays.asList("txt", "exe", "dll").contains(afterDot)) {
            return "No";
        }

        int digitCount = 0;
        for (char c : file_name.toCharArray()) {
            if (Character.isDigit(c)) {
                digitCount++;
            }
        }

        if (digitCount > 3) {
            return "No";
        }

        return "Yes";
    }
}

