class Solution {
    public int sum_squares(List<Integer> lst) {
        int sum = 0;
        for (int i = 0; i < lst.size(); i++) {
            if ((i + 1) % 3 == 0) {
                sum += lst.get(i) * lst.get(i); // Square the integer
            } else if ((i + 1) % 4 == 0 && (i + 1) % 3 != 0) {
                sum += lst.get(i) * lst.get(i) * lst.get(i); // Cube the integer
            } else {
                sum += lst.get(i); // Add the integer as it is
            }
        }
        return sum;
    }
}

