        planetOrder.put("Mercury", 1);
        planetOrder.put("Venus", 2);
        planetOrder.put("Earth", 3);
        planetOrder.put("Mars", 4);
        planetOrder.put("Jupiter", 5);
        planetOrder.put("Saturn", 6);
        planetOrder.put("Uranus", 7);
        planetOrder.put("Neptune", 8);

        List<String> result = new ArrayList<>();

        if (!planetOrder.containsKey(planet1) || !planetOrder.containsKey(planet2)) {
            return result;
