        int order2 = planetOrder.get(planet2);

        int minOrder = Math.min(order1, order2);
        int maxOrder = Math.max(order1, order2);

        for (Map.Entry<String, Integer> entry : planetOrder.entrySet()) {
            if (entry.getValue() > minOrder && entry.getValue() < maxOrder) {
                result.add(entry.getKey());
            }
        }

        result.sort(Comparator.comparingInt(planetOrder::get));
        return result;
    }
}

