class Solution {
    public String int_to_mini_roman(int number) {
        TreeMap<Integer, String> romanMap = new TreeMap<>(Collections.reverseOrder());
        romanMap.put(1000, "m");
        romanMap.put(900, "cm");
        romanMap.put(500, "d");
        romanMap.put(400, "cd");
        romanMap.put(100, "c");
        romanMap.put(90, "xc");
        romanMap.put(50, "l");
        romanMap.put(40, "xl");
        romanMap.put(10, "x");
        romanMap.put(9, "ix");
        romanMap.put(5, "v");
        romanMap.put(4, "iv");
        romanMap.put(1, "i");

        StringBuilder result = new StringBuilder();
        for (int value : romanMap.keySet()) {
            while (number >= value) {
                result.append(romanMap.get(value));
                number -= value;
            }
        }
        return result.toString().toLowerCase();
    }
}

