class Solution {
    public int do_algebra(List<String> operator, List<Integer> operand) {
        int result = operand.get(0); // Initialize result with the first operand
        int current = operand.get(0); // Initialize current with the first operand

        for (int i = 0; i < operator.size(); i++) {
            String op = operator.get(i);
            int num = operand.get(i + 1);

            switch (op) {
                case "+":
                    current += num;
                    break;
                case "-":
                    current -= num;
                    break;
                case "*":
                    current *= num;
                    break;
                case "/":
                    current /= num;
                    break;
                case "**":
                    current = (int) Math.pow(current, num);
                    break;
                default:
                    System.out.println("Invalid operator");
            }
        }

        return current;
    }
}

